import React from "react";
import MoviesData from "./MoviesData";
import "./Movies.css";

const Movies = () => {
  return (
    <>
      <div className="header">Movies Gallary</div>
      <div
        className="d-flex flex-wrap justify-content-center  bg-danger"
        style={{ height: "130vh" }}
      >
        {MoviesData.map((elem) => (
          <div className="card  m-2 " style={{ width: "32vh", height: "50vh" }}>
            <div className="">
              <img src={elem.imgUrl} alt=""  style={{width:""}}/>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default Movies;
